import React from 'react';
import styles from './Analyze.module.scss'
import { useState } from 'react';

export const Analyze = () => {
    const [url, changeUrl] = useState('zillow-url')
    const [price, changePrice] = useState('purchase price')
    const [budget, changeBudget] = useState('renovation budget')

    return (
        <div className={styles.analyzeGround}>
            <div className={styles.analyzeGround}>
                <h1>
                    <span>
                        Analyze!
                    </span>
                </h1>
            </div>
            <div className={styles.inputArea}>
                <div className={styles.inputDesc}>
                <input type="text" value={url} onClick={event => url === 'zillow-url' && changeUrl('')} onChange={event => changeUrl(event.target.value)}/>
                </div>
                <div className={styles.inputDesc}><input type="text" value={price} onClick={event => price === 'purchase price' && changePrice('')} onChange={event => changePrice(event.target.value)}/>
                </div>
                <div className={styles.inputDesc}><input type="text" value={budget} onClick={event => budget === 'renovation budget' && changeBudget('')} onChange={event => changeBudget(event.target.value)}/>
                </div>
                <button>Push</button>
                <script></script>
            </div>
        </div>
    )
}

export default Analyze;
